import React, { useEffect, useState } from 'react';
import axios from 'axios';



import './Box.css' ;

function Box (){
  const [data, sepata] = useState([]);
  useEffect(() => {
    axios.get('http://localhost:8081/')
      .then(res => sepata(res.data))
      .catch(err => console.log(err))
  }, []);


  return (
            <>
                <div className="Box" >
                <table className='table'>
          <thead>
            <tr>
              <th>Number Plate</th>
              <th>Car-Bran</th>
              <th>Car-Model</th>
              <th>Notes</th>
            </tr>
          </thead>
          <tbody>
            {data.map((car, index) => {
              return <tr key={index}>
                <td>{car.numcar}</td>
                <td>{car.bran}</td>
                <td>{car.model}</td>
                <td>{car.note}</td>
                <td>

                </td>
              </tr>
            })}
          </tbody>
        </table>
            </div>
            </>
      
    
  );


}

export default Box;
